<template>
  <div class="page">
    <CommonHeader :title="t('mallTitle')">
      <div class="hml-r integral"><i class="iconfont icon-shandian" />{{ userStore.userInfo.balance ? moneyFormat(userStore.userInfo.balance) : '0.00' }}</div>
    </CommonHeader>
    <main class="main">
      <div class="marketplace-box">
        <!-- vip等级 -->
        <div v-if="vipList.length > 0" class="step-vip">
          <div v-for="(item, index) of vipList" :key="index" :class="userStore.userInfo.vipCode == item.code ? 'sv-item active' : 'sv-item'">
            <label>x{{ item.integral }}</label>
            <span />
            <img :src="getAssetsFile(`grade/${item.code}.png`)" />
          </div>
        </div>
        <!-- tab切换 -->
        <div class="line-tabs" id="mk-tabs">
          <span :class="{ active: tab == 'rewards' }" @click="tab = 'rewards'">REWARDS</span>
          <span :class="{ active: tab == 'stats' }" @click="tab = 'stats'">MY STATS</span>
        </div>
        <div class="tab-content">
          <div v-show="tab == 'rewards'" class="tc-box">
            <!-- 赚取积分 -->
            <div class="earn-points">
              <dl>
                <dt>Earn Points</dt>
                <dd>
                  <a href="#">
                    <div class="a-l">
                      <i class="iconfont icon-ball-1" />
                    </div>
                    <div class="a-m">
                      <h3>Place Bets</h3>
                      <span>Bet & Earn</span>
                    </div>
                    <div class="a-r">
                      <i class="iconfont icon-enter" />
                    </div>
                  </a>
                </dd>
                <dd>
                  <a href="#">
                    <div class="a-l">
                      <i class="iconfont icon-qipai3" />
                    </div>
                    <div class="a-m">
                      <h3>Play Casino</h3>
                      <span>Spin & Win</span>
                    </div>
                    <div class="a-r">
                      <i class="iconfont icon-enter" />
                    </div>
                  </a>
                </dd>
                <!-- <dd>
                  <a href="#">
                    <div class="a-l">
                      <i class="iconfont icon-labax" />
                    </div>
                    <div class="a-m">
                      <h3>Refer Friends</h3>
                      <span>Passive Earnings</span>
                    </div>
                    <div class="a-r">
                      <i class="iconfont icon-enter" />
                    </div>
                  </a>
                </dd> -->
              </dl>
            </div>
            <!-- 商品列表 -->
            <div class="exclusive-rewards">
              <h2>Exclusive Rewards</h2>
              <div v-if="goodsList.length > 0" class="list">
                <template v-for="(item, index) of goodsList" :key="index">
                  <div v-if="item.productType == 0" class="item" @click="showDetails()">
                    <div class="er-img" v-lazy:background-image="appStore.cdnurl + item.images.split(',')[0]" />
                    <div class="er-title">{{ item.name }}</div>
                    <div class="er-mark">{{ item.intro }}</div>
                    <div class="er-price">
                      <i class="iconfont icon-shandian" />
                      <b>{{ moneyFormat(item.price) }}</b>
                    </div>
                  </div>
                </template>
              </div>
            </div>
