  AdjustType: 1,
  PageIndex: 1,
  PageSize: 10
})
let integralList = ref<getIntegralRecordItem[]>([])

const getIntegralVip = () => {
  getIntegralVipApi()
    .then((resp) => {
      vipList.value = resp.data
    })
    .catch((error) => {
      console.log(error)
    })
}

// 获取商品列表
const getGoodsList = () => {
  getGoodsListApi()
    .then((resp) => {
      goodsList.value = resp.data
      console.log(goodsList.value)
    })
    .catch((error) => {
      console.log(error)
    })
}

const exhangeGoods = (item: getGoodsListItem) => {
  exhangeGoodsApi({ Id: item.id })
    .then(() => {
      showToast('兑换成功')
    })
    .catch((error) => {
      console.log(error)
    })
}

// 获取积分记录
const getIntegralRecord = () => {
  getIntegralRecordApi(query)
    .then((resp) => {
      integralList.value = resp.data.items
    })
    .catch((error) => {
      console.log(error)
    })
}

